import React, {Component} from 'react';
import Sidebar from './sideBar';
import Transitions from './transitions';

class MainContent extends Component {
  render(){
    return (
      <div className='wrapper'>
        <Sidebar />
        <div className='main_content'>
          <div className='breadCrum'><a href='#'>Trang Chủ</a> - <a href='#'>VCB</a> - <a href='#'>Chuyển Khoản</a></div>
          <h2 className='pageTitle'>Xác Nhận Chuyển Tiền</h2>
          <Transitions />
          <div className='otp-area'>
            <h3>Nhập OTP</h3>
            <div id='challegeCode'>waiting...</div>
            <input type={'text'} id='otp'></input>
            <button id='submitOtp'>Gửi Otp</button>
          </div>
        </div>
      </div>
    )
  }
}

export default MainContent;
